import React from 'react';

import './card-list.styles.css';

export const CardList = props => {
    return (
        <div className='card-list'>
            {this.props.monsters.map(monster => (
                <h1 key={this.monster.id}> { this.monster.name } </h1>
                ))} 
        </div>);
};
